import React from "react";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import {
    Nav,
    Row,
    Col,
    Button,
    Form,
    FormGroup,
    Badge,
    Container,
} from "react-bootstrap";

import Login from "./SignIn";
import SignUp from "./SignUp";

function SignInSignUpRouter() {
    function test(values) {
        console.log(values);
    }
    return (
        <Container>
            <Row className="justify-content-center">
                <Col md={6}>
                    <Router>
                        <Nav
                            fill
                            variant="tabs"
                            className="justify-content-end  navbar-dark bg-dark"
                        >
                            <Nav.Item>
                                {" "}
                                <Link className="nav-link" to={"/sign-in"}>
                                    <h3>
                                        <Badge variant="dark">Login</Badge>
                                    </h3>
                                </Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Link className="nav-link" to={"/sign-up"}>
                                    <h3>
                                        <Badge variant="dark">Sign Up</Badge>
                                    </h3>
                                </Link>
                            </Nav.Item>
                        </Nav>

                        <Switch>
                            <Route
                                exact
                                path="/"
                                // component={
                                //     <Login {...props} onSubmit={test}></Login>
                                // }
                                render={(props) => {
                                    return (
                                        <Login
                                            {...props}
                                            onSubmit={test}
                                        ></Login>
                                    );
                                }}
                            />
                            <Route
                                path="/sign-in"
                                // component={Login}
                                render={(props) => {
                                    return (
                                        <Login
                                            {...props}
                                            onSubmit={test}
                                        ></Login>
                                    );
                                }}
                            />
                            <Route
                                path="/sign-up"
                                // component={SignUp}
                                render={(props) => {
                                    return (
                                        <SignUp
                                            {...props}
                                            onSubmit={test}
                                        ></SignUp>
                                    );
                                }}
                            />
                        </Switch>
                    </Router>
                </Col>
            </Row>
        </Container>
    );
}

export default SignInSignUpRouter;
